// frontend/src/components/HomePage.js
import React from 'react';
import { Link } from 'react-router-dom';

const HomePage = () => {
  return (
    <div style={{ textAlign: 'center', padding: '20px' }}>
      <h1>Welcome to the Invoice Management System</h1>
      <p>Efficiently manage your invoices with our platform.</p>
      <div>
        <Link to="/invoices" style={{ margin: '10px', textDecoration: 'none', color: 'blue' }}>
          View Invoices
        </Link>
        <Link to="/login" style={{ margin: '10px', textDecoration: 'none', color: 'blue' }}>
          Login
        </Link>
      </div>
    </div>
  );
};

export default HomePage;
